import React from 'react' ;
import { Link } from 'react-router-dom'

class Login extends React.Component{
	constructor(props){
		super(props);
		this.state = {
			form : {
				values: {
					email : '',
					password: '',
				},
				errors: {
					email: {
						errorClass: '',
						errorMsg: '',
						isError: true
					},
					password: {
						errorClass: '',
						errorMsg: '',
						isError: true
					}
				}
			}			
		};

		this.handleSubmit = this.handleSubmit.bind(this);
		this.handleChange = this.handleChange.bind(this);
	}
  	/*componentDidMount() {
		fetch('http://amigoview.com/iosdemo/login.php', {
			method: 'POST',
			body: JSON.stringify({
				email: 'New title added',
				password: 'New body added. Hello body.'
			}),
			headers: {
				"Content-type": "application/json; charset=UTF-8"
			}
		}).then(response => {
				return response.json()
			}).then(json => {
				this.setState({
					user:json
				});
			});
	}*/

	handleChange ( event ) {

		console.log(event);

		let name = event.target.name;	
		let value = event.target.value;

		let newState = this.state;

		switch ( name ) {

			default:
				break;
			case 'email':

				if ( value.length === 0 ) {

					newState.form.errors.email.errClass = 'has-error';
					newState.form.errors.email.errMsg = ' * This field is required.';
					newState.form.errors.email.isError = true;
				} else {

					newState.form.errors.email.errClass = 'has-success';
					newState.form.errors.email.errMsg = '';
					newState.form.errors.email.isError = false;
				}

				newState.form.values.email = value;

				break;
			case 'password':

				if ( value.length === 0 ) {

					newState.form.errors.password.errClass = 'has-error';
					newState.form.errors.password.errMsg = ' * This field is required.';
					newState.form.errors.password.isError = true;
				} else {

					newState.form.errors.password.errClass = 'has-success';
					newState.form.errors.password.errMsg = '';
					newState.form.errors.password.isError = false;
				}

				newState.form.values.password = value;
				break;
		}

		console.log(newState);

		this.setState(newState);
	}

	handleSubmit() {


	}

	render(){
		return (
			<div className="login-form">
				<form onSubmit={this.handleSubmit}>

				  <div className="container">

				  	<div className={'form-group ' + this.state.form.errors.email.errorClass}>

						<label><b>Username</b></label>
				    	<input type="text" placeholder="Enter Username" name="email" value={this.state.form.values.email} onChange={this.handleChange} />
				    	<div className="help-block">{ this.state.form.errors.email.errorMsg }</div>

				  	</div>

				  	<div className={'form-group ' + this.state.form.errors.password.errorClass}>

						<label><b>Password</b></label>
				    	<input type="password" placeholder="Enter Password" name="psw" value={this.state.form.values.password} onChange={this.handleChange} />
				    	<div className="help-block">{ this.state.form.errors.password.errorMsg }</div>

				  	</div>

				    <button type="submit">Login</button>
				    {/*<label>
				      <input type="checkbox" checked="checked" name="remember" /> Remember me
				    </label>*/}
				  </div>

				  <div className="container cancel-panel" style={{background:"#f1f1f1"}}>
				  	<div className="cancelbtn-div"><button type="button" className="cancelbtn">Cancel</button></div>
				    <div className="register"><span className="psw">Don't have account <Link to={'/register'}>Register Here</Link></span></div>
				    <div className="forgotpsw"><span className="psw">Forgot <Link to={'#'}>password?</Link></span></div>
				  </div>
				</form>
			</div>
		)
	}
}

export default Login
